function main5_chart(data){
	var time_list = []
	var dcard_val = []
	var ptt_val = []
	var fb_val = []

	for (var i = 0; i < data.length; i++) {
		time_list.push(epoch_to_date(data[i]['datetime']))

		dcard_val.push(data[i]['dcard'])
		ptt_val.push(data[i]['ptt'])
		fb_val.push(data[i]['fb'])
	}

	var chartDom = document.getElementById('main5');
	var myChart = echarts.init(chartDom);
	window.addEventListener('resize', ()=> {
		// myChart.resize()
		echarts.init(document.getElementById('main5')).resize()
	})
	var option;

	option = {
	    title: {
	        text: ''
	    },
	    tooltip: {
	        trigger: 'axis'
	    },
	    legend: {
	        data: ['facebook', 'dcard', 'ptt']
	    },
	    grid: {
	        left: '3%',
	        right: '4%',
	        bottom: '3%',
	        containLabel: true
	    },
	    xAxis: {
	        type: 'category',
	        boundaryGap: false,
	        data: time_list
	    },
	    yAxis: {
	        type: 'value'
	    },
	    series: [
	        {
	            name: 'facebook',
	            type: 'line',
	            stack: 'Total',
	            data: fb_val
	        },
	        {
	            name: 'dcard',
	            type: 'line',
	            stack: 'Total',
	            data: dcard_val
	        },
	        {
	            name: 'ptt',
	            type: 'line',
	            stack: 'Total',
	            data: ptt_val
	        }
	    ]
	};
	option && myChart.setOption(option);
}